import React from 'react';

const Dashboard = () => {
  return (
    <div style={{ padding: '30px' }}>
      <h2 style={{ fontSize: '1.8rem', marginBottom: '20px', color: '#333' }}>Dashboard</h2>
      <div style={{ background: 'white', padding: '20px', borderRadius: '8px', boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
        <p style={{ color: '#555' }}>Chào mừng bạn đến với trang tổng quan! Tại đây bạn có thể xem các thông tin chung về hệ thống quản lý điểm.</p>
        <p style={{ color: '#555', marginTop: '10px' }}>Sử dụng menu bên trái để điều hướng đến các chức năng khác.</p>
      </div>
    </div>
  );
};

export default Dashboard;
